import React from "react";

const Footer = () => {
  return (
    <div className="footer-container">
      <div className="left-part">
        <img src="../public/img/logo.png" alt="" />
      </div>
      <div className="middle-part"></div>
      <div className="right-part"></div>
    </div>
  );
};

export default Footer;
